import logo from './logo.svg';
import './App.css';


function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
      <body>
        <button className="move-button js-rock-button">
          <img src="images/rock-emoji.png" className="move-icon" />
        </button>

        <button className="move-button js-paper-button">
          <img src="images/paper-emoji.png" className="move-icon" />
        </button>

        <button className="move-button js-scissors-button">
          <img src="images/scissors-emoji.png" className="move-icon" />
        </button>

        <p className="js-result result"></p>
        <p className="js-moves"></p>
        <p className="js-score score"></p>

        <button
          onClick={() => {
            score.wins = 0;
            score.losses = 0;
            score.ties = 0;
            localStorage.removeItem("score");
            updateScoreElement();
          }}
          className="reset-score-button js-reset-score-button"
        >
          Reset Score
        </button>

        <button className="auto-play-button" onClick={() => autoPlay()}>
          Auto Play
        </button>

        <script src="scripts/12-rock-paper-scissors.js"></script>

      </body>
    </div>
  );
}

export default App;
